    <ul> 
      <li> items[0]</li>
      <li> Build awesome project</li>
    </ul>
  );
}
const SearchPanel = () => {
  return (
    <input placeholder = "search" />
  );
}
const Hed = () => {
  return (
    <h1>My to do List</h1>
  );
}
const App = () => {
  return (
    <div>
      <Hed />
      <SearchPanel />
      <TodoList />
    </div>
  );
}
const el = App();
ReactDOM.render(el, document.getElementById('root'));
